import React, { useState } from 'react';
import './UploadNotes.css';

function UploadNotes() {
  const [folderData, setFolderData] = useState([
    { name: "Math", files: [], subfolders: [] },
    { name: "Science", files: [], subfolders: [] },
  ]);

  const [selectedFolder, setSelectedFolder] = useState("Math");
  const [editingFolder, setEditingFolder] = useState(null);
  const [editName, setEditName] = useState("");
  const [showMenu, setShowMenu] = useState(null);
  const [showActionMenu, setShowActionMenu] = useState(false);

  // Toggle folder menu visibility
  const toggleMenu = (folderName) => {
    setShowMenu(showMenu === folderName ? null : folderName);
  };

  // Toggle action menu visibility
  const toggleActionMenu = () => {
    setShowActionMenu(!showActionMenu);
  };

  // Handle file upload for a specific folder or subfolder
  const handleFileUpload = (event, folderName, subfolderName = null) => {
    const uploadedFiles = Array.from(event.target.files).map((file) => file.name);

    setFolderData((prevData) =>
      prevData.map((folder) => {
        if (folder.name === folderName) {
          if (subfolderName) {
            // Adding file to a specific subfolder
            folder.subfolders = folder.subfolders.map((subfolder) =>
              subfolder.name === subfolderName
                ? { ...subfolder, files: [...subfolder.files, ...uploadedFiles] }
                : subfolder
            );
          } else {
            // Adding file to the main folder
            folder.files = [...folder.files, ...uploadedFiles];
          }
        }
        return folder;
      })
    );
    setShowMenu(null);
  };

  // Add a new subfolder to a specific folder
  const handleAddSubfolder = (folderName, subfolderName = null) => {
    setFolderData((prevData) =>
      prevData.map((folder) => {
        if (folder.name === folderName) {
          if (subfolderName) {
            folder.subfolders = folder.subfolders.map((subfolder) =>
              subfolder.name === subfolderName
                ? { ...subfolder, subfolders: [...subfolder.subfolders, { name: "New Subfolder", files: [] }] }
                : subfolder
            );
          } else {
            folder.subfolders = [...folder.subfolders, { name: "New Subfolder", files: [] }];
          }
        }
        return folder;
      })
    );
    setShowMenu(null);
  };

  // Rename a folder or subfolder
  const handleEditFolder = (folderName, subfolderName = null) => {
    setEditingFolder(subfolderName || folderName);
    setEditName(subfolderName || folderName);
    setShowMenu(null);
  };

  // Save the edited name for a folder or subfolder
  const handleSaveEdit = () => {
    setFolderData((prevData) =>
      prevData.map((folder) => {
        if (folder.name === editingFolder) {
          return { ...folder, name: editName };
        } else if (folder.subfolders.some((sub) => sub.name === editingFolder)) {
          folder.subfolders = folder.subfolders.map((subfolder) =>
            subfolder.name === editingFolder ? { ...subfolder, name: editName } : subfolder
          );
        }
        return folder;
      })
    );
    setEditingFolder(null);
  };

  // Delete a folder or subfolder
  const handleDeleteFolder = (folderName, subfolderName = null) => {
    setFolderData((prevData) =>
      prevData.map((folder) => {
        if (folder.name === folderName) {
          if (subfolderName) {
            folder.subfolders = folder.subfolders.filter((sub) => sub.name !== subfolderName);
          } else {
            return null;
          }
        }
        return folder;
      }).filter(Boolean)
    );
    setShowMenu(null);
  };

  return (
    <div className="upload-notes-page">
      <div className="sidebar">
        <div className="sidebar-header">
          <h3>Folders</h3>
          <span className="add-icon" onClick={toggleActionMenu}>+</span>
          {showActionMenu && (
            <div className="action-menu">
              <button onClick={() => setFolderData([...folderData, { name: "New Folder", files: [], subfolders: [] }])}>
                New Folder
              </button>
              <button onClick={() => document.getElementById('file-upload-main').click()}>Upload File</button>
              <input
                type="file"
                id="file-upload-main"
                style={{ display: "none" }}
                onChange={(e) => handleFileUpload(e, selectedFolder)}
              />
            </div>
          )}
        </div>
        <ul className="folder-list">
          {folderData.map((folder) => (
            <li key={folder.name}>
              <div className="folder-header" onClick={() => setSelectedFolder(folder.name)}>
                <span>{folder.name}</span>
                <div className="menu-container">
                  <span className="menu-icon" onClick={() => toggleMenu(folder.name)}>⋮</span>
                  {showMenu === folder.name && (
                    <div className="dropdown-menu">
                      <button onClick={() => handleEditFolder(folder.name)}>Rename</button>
                      <button onClick={() => handleAddSubfolder(folder.name)}>Create Subfolder</button>
                      <button onClick={() => document.getElementById(`file-upload-${folder.name}`).click()}>
                        Upload File
                      </button>
                      <button onClick={() => handleDeleteFolder(folder.name)}>Delete</button>
                      <input
                        type="file"
                        multiple
                        id={`file-upload-${folder.name}`}
                        style={{ display: "none" }}
                        onChange={(e) => handleFileUpload(e, folder.name)}
                      />
                    </div>
                  )}
                </div>
              </div>

              {/* Display files under each folder */}
              <ul className="file-list">
                {folder.files.map((fileName, index) => (
                  <li key={index} className="file-item">{fileName}</li>
                ))}
              </ul>

              {/* Display subfolders */}
              <ul className="subfolder-list">
                {folder.subfolders.map((subfolder, index) => (
                  <li key={index} className="subfolder-item">
                    <div className="folder-header">
                      <span>{subfolder.name}</span>
                      <div className="menu-container">
                        <span className="menu-icon" onClick={() => toggleMenu(`${folder.name}-${subfolder.name}`)}>⋮</span>
                        {showMenu === `${folder.name}-${subfolder.name}` && (
                          <div className="dropdown-menu">
                            <button onClick={() => handleEditFolder(folder.name, subfolder.name)}>Rename</button>
                            <button onClick={() => handleAddSubfolder(folder.name, subfolder.name)}>Create Subfolder</button>
                            <button onClick={() => document.getElementById(`file-upload-${folder.name}-${subfolder.name}`).click()}>
                              Upload File
                            </button>
                            <button onClick={() => handleDeleteFolder(folder.name, subfolder.name)}>Delete</button>
                            <input
                              type="file"
                              multiple
                              id={`file-upload-${folder.name}-${subfolder.name}`}
                              style={{ display: "none" }}
                              onChange={(e) => handleFileUpload(e, folder.name, subfolder.name)}
                            />
                          </div>
                        )}
                      </div>
                    </div>
                    <ul className="file-list">
                      {subfolder.files.map((fileName, index) => (
                        <li key={index} className="file-item">{fileName}</li>
                      ))}
                    </ul>
                  </li>
                ))}
              </ul>

              {editingFolder === folder.name && (
                <input
                  type="text"
                  value={editName}
                  onChange={(e) => setEditName(e.target.value)}
                  onBlur={handleSaveEdit}
                  onKeyDown={(e) => e.key === 'Enter' && handleSaveEdit()}
                  autoFocus
                />
              )}
            </li>
          ))}
        </ul>
      </div>

      <div className="content">
        <h3>{selectedFolder} Notes</h3>
        <p>Select options in the sidebar to manage files and folders.</p>
      </div>
    </div>
  );
}

export default UploadNotes;
